class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

class Solution:
    def maximum(self, arr, k):
        """
        :type arr: ListNode
        :type k: int
        :rtype: ListNode
        """
        ans = []
        ans_dict = {}
        ans_list = []
        for i in arr:
            if i > 0:
                ans_dict[i] = 1
        for i in sorted(ans_dict.keys()):
            ans_list.append(i)
            ans.append(i)
            if len(ans) == k:
                break
        return ans

