def x_or_y(n, x, y):
    #  NOTE: 'n' is the number to check, 'x' is the value to return 
    #  if n is prime and 'y' is the value to return if n is not prime
    #  NOTE: 'i' is a counter for the loop
    for i in range(2, n):
        if n % i == 0:
            return y
    return x
